import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const FooterContainer = styled.div`
    background-color: #f7f7f7;
    height:480px;
    padding:60px 80px;

    .footerInner{
      background-color: #00f5;
      width:100%;
      height:100px;
      display: flex;

      .footerInfo{
        background-color: #ff0;
        width:60%;
      }

      .footerMenu{
        background-color: #f60;
        width:40%;

      }
    }
`;

const Footer = memo(() => {

  const {footerInfo, subInfo} = dataset.footer;
  const {callNumber, consultationTime, orderEmail, SponsoredEmail} = footerInfo;
  console.log(footerInfo,subInfo);
  return (
    <FooterContainer>
      <div className='footerInner'>
        <div className='footerInfo'>
          <h1>{callNumber}</h1>
          <p>{consultationTime}</p>
          <p>{orderEmail}</p>
          <p>{SponsoredEmail}</p>

        </div>
        <div className='footerMenu'></div>
      </div>
    </FooterContainer>
  );
});

export default Footer;
